import Navber from "./Component/navber";
import CartDetails from "./Component/Cartdetails";




const App = () => {
     let dateCart = {
       title: "HTML",
       discription: "Props are passed to components via HTML attributes.",
     }
    return (
      <div>
      <Navber></Navber>
      <CartDetails title={dateCart.title}/>
      <CartDetails title={dateCart.title}/>
      <CartDetails title={dateCart.title}/>
      </div>
    )

}

export default App;
